void VBernstein(const Standard_Integer classe, 
		const Standard_Integer nbpoints,
		math_Matrix&           M)
{
  if (classe > 26) Standard_DimensionError::Raise("VBernstein: classe > 26");
  if (nbpoints > 24) Standard_DimensionError::Raise("VBernstein: nbpoints > 24");
  //  math_Matrix VB(classe, nbpoints);
  
  Standard_Integer i, j, k = 0, Som;
  // 300 = 1+2+  ... +24 points.
  Som = (Standard_Integer )( 300*((classe-1)*classe/2.-1) + classe * (nbpoints-1)*nbpoints/2.);
  
  const Standard_Real *tmpVB;
  tmpVB = VBMatrix + Som;
  for (i = 1; i <= classe; i++) {
    for (j = 1; j <= nbpoints; j++) {
      M(i, j) = *tmpVB;
      tmpVB++;
      k++;
    }
  }
}



